import React from 'react'
import styled from "styled-components";

const Section = styled.a`
    font-size: ${(props) => props.theme.fontLargest};
    font-weight: 900;
    letter-spacing: 1px;
    color: ${(props) => props.theme.primaryColor}
`;
const Logo = () => {
  return (
    <Section>
        hanuut
    </Section>
  )
}

export default Logo
